import {Fragment} from "react"
import { PURPLE, BACKGROUND, FOREGROUND } from "../helpers/colors"

const Contacts = () => {
    return (
        <>
                <h3 style={{ color: FOREGROUND }}>Contacts</h3>
        </>
    )
}

export default Contacts
